import React from "react";

export default class Model extends React.Component{
    constructor(props) {
        super(props);
        console.log(props);
        console.log("In Model");
        this.state = {
            state:props.state,
            date:props.date,
            cases:props.cases,
            deaths:props.deaths,
        }
        console.log(this.state);
    }

    render() {
        return (
            <div className = "Model">
                <div class="card">
                    <ul class="list-group list-group-flush">
                        {this.state.state && <li class="list-group-item"><label>State:{this.state.state}</label></li>}
                        {this.state.date && <li class="list-group-item"><label>Date:{this.state.date}</label></li>}
                        {this.state.cases && <li class="list-group-item"><label>Cases:{this.state.cases}</label></li>}
                        {this.state.deaths && <li class="list-group-item"><label>Deaths:{this.state.deaths}</label></li>}
                    </ul>
                </div>
            </div>
        )
    }
}
